import React from 'react';
import './HomePage.css';
import FishingSpotList from '../components/FishingSpotList';
import { useHistory } from 'react-router-dom';
import { useJsApiLoader } from '@react-google-maps/api';
import { signOut } from "firebase/auth";
import { auth } from '../firebase';

const HomePage = () => {
    const history = useHistory();
    const { isLoaded } = useJsApiLoader({
        googleMapsApiKey: "AIzaSyAgtx6yT4yO1KxGO1qRIDAbi2saRZYjwJ8",
        libraries: ['places'] // <-- Add this line!
    });

    const handleLogout = async () => {
        await signOut(auth);
        history.push('/login');
    };

    return (
        <div className="home-page stylish-bg">
            <header className="home-header">
                <div className="header-content">
                    <span className="header-icon">ðŸŽ£</span>
                    <h1 className="header-title">Fishing Spots</h1>
                </div>
                <div className="logout-btn-wrap">
                    <button className="logout-btn" onClick={handleLogout}>
                        Logout
                    </button>
                </div>
            </header>
            <main className="home-main">
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginBottom: 32 }}>
                    <input
                        className="search-bar"
                        type="text"
                        placeholder="State, Species, Technique"
                        style={{ maxWidth: '700px', width: '100%', marginBottom: 24 }}
                    />
                    <div className="share-spot-btn-wrap">
                        <button className="share-spot-btn" style={{ fontSize: '1.2em', fontWeight: 800, boxShadow: '0 6px 24px #2176d255', border: '2px solid #fff', background: 'linear-gradient(90deg, #2176d2 60%, #43c6ac 100%)', color: '#fff', padding: '16px 44px', borderRadius: '32px', letterSpacing: '1px', display: 'flex', alignItems: 'center', gap: '12px' }}>
                            <span style={{ fontSize: '1.3em', color: '#ff69b4', fontWeight: 900 }}>+</span> Share Spot
                        </button>
                    </div>
                </div>
                <FishingSpotList isLoaded={isLoaded} />
            </main>
        </div>
    );
};

export default HomePage;
